import React from "react";
import "../style/PortfolioHome.css";

export const PortfolioHome = () => {
  return (
    <div className="container">
      <span className="heading">Hello I am</span>
      <span className="subheading">Ethan Jordon</span>
      <span className="subheading">Front-End Developer</span>
      <span className="paragraph">
        I'm a passionate junior Front-End Developer based in Seattle WA,
        currently studying Software Engineering with a strong interest in Web
        Development. I'm committed to creating visually stunning and
        user-friendly websites, and I'm looking forward to exploring new
        opportunities to enhance my skills.
      </span>
      <a href="Docs/resume" className="link">
        Get my resume
      </a>
    </div>
  );
};
